Mapon GO 2021 is a new and improved version of the Mapon driver mobile application and is available to all registered Mapon platform users. It's still at an early stage of development and offers only a fraction of the features currently available on Mapon GO. However, we're expecting to expand the functionality of Mapon GO 2021 in the future. What's more, the new app already offers such added benefits as GPS tracking, as well as enhanced overall application speed and design for better user experience.     
The Mapon GO 2021 application is an effective tool capable of improving overall business efficiency. It gives the opportunity for drivers to communicate and exchange important information with the back-office in a digitised space. Less paper, faster communication, easy information access and more!

 FEATURES:
* Dashboard - for easy overview and access to relevant information;
* Messaging - for keeping in touch with the back office, forwarding tasks and making sure no files, orders or pictures go missing;
* Mobile tracking - provides built-in mobile tracker functionality; 
* Route history - a complete log with all of the driver's previous travels;
* Settings - for easy set-up and customisation;
* Login.

Outdoor Navigator is a fancy GPS 3D compass that can lead you to your destination,  even if there are no roads, even if you are offline.

Outdoor Navigator has an innovating design, simple, beautiful and practical. It uses a 3D Floating Arrow to show you your way regardless how you hold the iPhone in your hand.
Most used features are one touch away, from where you would expect it.

Use Outdoor Navigator to locate spots at open areas like rural regions, concerts areas, sea or other uncharted areas just by following the 3D Arrow. 

Works offline. Spot coordinates can be entered manually, using a map or even satellite view.


Features List:
- Point to destination Spot, in coordinates.
 A 3D Arrow will give the direction of your destination as you go;
- Floating 3D Arrow. The 3D needle keeps pointing to the spot in the horizontal plan regardless the iPhone orientation, like if it is floating on water;
- Spot Archive. Save your spots to load later (payed feature);
- Set destination offline. Enter coordinates manually;
- Set destination online. Enter coordinates by using a map or a satellite view;
- Returning point. Use current location as the destination;
- Track location. Show current coordinates and current address as you go;
- Search POI and locations near by;
- Automatic coordinate to address translation;
- Compass. A small compass always points to the North;
- Map follows user position and rotates automatically to align with user direction.
- Share Locations. Post your location or any previous saved location to any sharing services;
Apple maps links included in shares by e-mail);
- Read coordinates in text shared from other apps.

What to do in Amsterdam?
Here you go!

Get the city in your smartphone, and enjoy your stay like a local.
City guide with all points of interest, and special venues selected by locals.

Purchase digital tickets via your smartphone; no printing required, skip the lines, use the speed lanes, and get discounts.

Detailed digital city map showing where you are and where your chosen venue is, including distance and navigation. Clearly marked shopping and nightlife areas.
With landmarks appearing as 3D drawings, very detailed city-center map, and overview map including suburbs and Schiphol airport.

Check the hotel page to stay in touch with your hotel, get information about the hotel and hotel services, and view the gallery. Options to book a room for your next stay.
Share your stay with your friends on social media.

This app is made by local specialists and contains detailed information about:
Restaurants, diamond museums, jewelers;
Attractions, museums, historical buildings;
Shopping areas, fashion stores, markets and squares;
Nightlife areas, clubs, pubs, coffeeshops (the Dutch kind);
Concert halls, theatres, guided tours;
Tram-, and taxi information, bike rental;
Nearby metro- and train stations.

Get Holland Brochure Services: City Guide now to find the things you NEED to do in Amsterdam and get your tickets ahead of time.

